import logo from './logo.svg';
import './App.css';
import { Header } from './component/header';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p><Header /></p>

      </header>
    </div>
  );
}

export default App;
